// Single error - format it for the email
const error = $input.first().json;
const nodeName = error.node?.name || 'Unknown node';

// Handle different error formats from different APIs
let errorMsg = 'Unknown error';

// HeyGen error format: { "error": { "code": "...", "message": "...", "detail": "..." } }
if (error.error?.code && error.error?.message) {
  errorMsg = `[${error.error.code}] ${error.error.message}`;
  if (error.error.detail) {
    errorMsg += ` - ${error.error.detail}`;
  }
}
// Cloudinary error format: { "error": { "message": "..." } }
else if (error.error?.message) {
  errorMsg = error.error.message;
}
// ElevenLabs error format: { "error": { "code": "...", "message": "..." } }
// (Same structure as HeyGen but without detail field - handled by first condition)
// Generic message fallback
else if (error.message) {
  errorMsg = error.message;
}

return [{
  json: {
    nodeName: nodeName,
    errorMessage: errorMsg,
    timestamp: new Date().toISOString(),
    rawError: JSON.stringify(error, null, 2) // Include full error for debugging
  }
}];

const config = $json;
const sectionTimings = config._section_timings;

if (!sectionTimings || sectionTimings.length === 0) {
  throw new Error('No section timings found!');
}

console.log('Calculating car timings for', sectionTimings.length, 'sections');

// Extract car timings (sections that aren't hook or cta)
const carTimings = sectionTimings.filter(t => 
  t.name !== 'hook' && t.name !== 'cta'
);

// Update vehicles with accurate timings
const updatedVehicles = config.vehicles ? config.vehicles.map((vehicle, index) => {
  const carTiming = carTimings[index];

  if (!carTiming) {
    console.warn(`No timing found for vehicle ${index + 1} (${vehicle.vin})`);
    return vehicle;
  }

  return {
    ...vehicle,
    start_time: Math.round(carTiming.start),
    end_time: Math.round(carTiming.end)
  };
}) : [];

// Total duration from last section's end time
const totalDuration = Math.round(sectionTimings[sectionTimings.length - 1].end);

return [{
  json: {
    ...config,
    vehicles: updatedVehicles,
    audio_duration: totalDuration
  },
  binary: $input.first().binary
}];

