const response = $json;
const words = response.words;
const binary = $("Parse TTS Response").first().binary;
const config = $('Prepare for Forced Alignment').first().json;
const script = config.script;

// Build section texts in order
const sections = [
  { name: 'hook', text: script.hook },
  ...script.segments.map((text, i) => ({ name: `segment_${i}`, text })),
  { name: 'cta', text: script.cta }
];

const sectionTimings = [];
let wordIndex = 0;

for (const section of sections) {
  const sectionWords = section.text.split(/\s+/).filter(w => w.length > 0);
  const startWordIndex = wordIndex;
  const endWordIndex = wordIndex + sectionWords.length - 1;

  const startTime = words[startWordIndex]?.start || 0;
  const endTime = words[endWordIndex]?.end || startTime;

  sectionTimings.push({
    name: section.name,
    start: startTime,
    end: endTime,
    duration: endTime - startTime
  });

  wordIndex += sectionWords.length;
}

console.log('Section timings:', sectionTimings);

return [{
  json: {
    ...config,
    _section_timings: sectionTimings
  },
  binary:binary
}];
